import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Sdata from './Sdata';

ReactDOM.render(
    <>
    <App 
        imagesrc={Sdata[0].imagesrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link} />

    <App 
        imagesrc="https://images.unsplash.com/photo-1630180842134-3118cfef351a?ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwxM3x8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"
        title=' This is a beauty picture'
        sname='naure'
        link='#' />

    <App 
        imagesrc="https://images.unsplash.com/photo-1630209642854-432d7f3f0e52?ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwxN3x8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"
        title=' This is a beauty picture'
        sname='sky'
        link='#' />

    <App 
        imagesrc="https://images.unsplash.com/photo-1630142918036-523eab28cd69?ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw4NXx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"
        title=' This is a beauty picture'
        sname='gate'
        link='#' />
        </>,
   document.getElementById('root')
);
